    useEffect(()=>{
      
         if(currentUser){
            setCurrentUserName(currentUser.name);
            setcurrentUserImage(currentUser.avatarImage);
         }
         
    },[currentUser])
     
  return (
    <>
           {/* {currentUserName && currentUserImage &&( */}

               <div>
                   <div className='flex'>
                        <img src={Logo} alt="logo" className='h-[8vh] w-[10vw]'/>
                         <h1>chatme</h1>
                        
                   </div>
               </div>
           {/* )} */}
    </>
    
  )
}

